import React from "react";
import posts from "./MyPosts.module.css";
import Post from "./Post/Post";

const MyPosts = () => {
    return (
        <div>
            My posts
            <div>New post</div>
            <div className={posts.block}>
                <Post message="hello!" />
                <Post message="I's my fir!" />
            </div>
        </div>
    );
};

export default MyPosts;
